import * as types from './types'

export const getUser = () => ({
    type: types.TEST_GET_METHOD
})
export const getUserSuccess = (data) => ({
    type: types.TEST_GET_SUCCESS,
    payload:data
})
export const  getUserErr = (err) => ({
    type: types.TEST_GET_METHOD_ERR,
    err
})
